import React from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';

const Navbar = () => {
  return (
    <div className='containerStyle' style={{ alignItems: 'center', backgroundColor: 'white' }}>
      <div style={{ color: 'black', textAlign: 'left', backgroundColor: '#82E0AA', height: '10vh' }}>
        <h1>Account Management</h1>
      </div>

      <li className="nav-item">
        <a className="nav-link active" aria-current="page" href="#">Home</a>
      </li>

      <div style={{ display: 'flex', justifyContent: 'center' }}>
        <div style={{ marginRight: '10px' }}>
          <div style={{ marginBottom: '5px' }}>From Date</div>
          <DatePicker className="form-control me-2" placeholderText="From Date" />
        </div>
        <div style={{ marginRight: '10px' }}>
          <div style={{ marginBottom: '5px' }}>To Date</div>
          <DatePicker className="form-control me-2" placeholderText="To Date" />
        </div>
        <button className="btn btn-outline-success" type="submit">Search</button>
      </div>
    </div>
  );
};

export default Navbar;
